import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Rooms from './pages/Rooms';
import Booking from './pages/Booking';
import Payments from './pages/Payments';
import Login from './pages/Login';
import AdminLayout from './layouts/AdminLayout';  // Only one import for AdminLayout
import ProtectedRoute from './components/ProtectedRoute'; // Correct import path


const App = () => (
  <Router>
    <Navbar />
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/login" element={<Login />} />
      <Route path="admin" element={<AdminLayout />}>
        <Route path="rooms" element={<Rooms />} />
        <Route path="bookings" element={<Booking />} />
        <Route path="payments" element={<Payments />} />
      </Route>
      {/* Wrap routes that need protection */}
      <Route path="/payments" element={<ProtectedRoute element={Payments} />} />
    </Routes>
  </Router>
);

export default App;
